def fill_with_state(form, start, end):
    if end > 117:
        end = 117
    for i in range(start, end + 1):
        key = 'TreeView1n' + str(i) + 'CheckBox' + '=on&'
        form += key
    return form


def fill_with_commodity(form, commodity_number_start, commodity_number_end):
    for i in range(commodity_number_start, commodity_number_end + 1):
        key = 'TreeView2n' + str(i) + 'CheckBox' + '=on&'
        form += key
    return form


def fill_with_year(form, start, end):
    if end > 264:
        end = 264
    for i in range(start, end + 1):
        key = 'TreeViewDaten' + str(i) + 'CheckBox' + '=on&'
        form += key
    return form


